import React, {Fragment} from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import LoginIcon from '@mui/icons-material/Login';
import WorkIcon from '@mui/icons-material/Work';
// ============= ROUTES ================
import { NavLink } from 'react-router-dom';
//=====================================
const Home = ()=>{
  const Studies = ()=> {
    console.log('hola');
    return(<NavLink to='/studies'></NavLink>)};
  return(
<Fragment>
      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            <WorkIcon sx={{ fontSize: 15 }}/>BreafCase
          </Typography>
          <Button color="inherit">Home</Button>
          <NavLink to="/Studies" style={{textDecoration: "none", color: "white", fontSize:14, fontFamily:'Roboto'}}>STUDIES</NavLink>
          <Button color="inherit">Experiences</Button>
          <Button color="inherit">Projects</Button>
          <Button color="inherit">Contact</Button>
          <Button color="inherit"><LoginIcon />Login</Button>
        </Toolbar>
      </AppBar>
    </Box>
    </Fragment>
  );
  };
  export default Home;
